import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const Nav = styled.nav`
  background: ${props => props.theme.colors.bg_base_dark};
  width: 100%;
`;

const Menu = styled.menu`
  background: ${props => props.theme.colors.bg_base_dark};
  width: 100%;
`;

const Brand = styled.div`
  width: 200px;
  > img {
    width: 100%;
  }
`

function Navbar() {
  return (
    <>
      <Nav>
        <Menu className="menu">
          <div className="logo">
            <Brand>
              <img src="/images/Logo.png" alt="my image" />
            </Brand>
          </div>
          <div className="item"><a href="#">Home</a></div>
          <div className="item"><a href="#">About</a></div>
          <div className="item"><a href="#">Services</a></div>
          <div className="item"><a href="#">Features</a></div>
          <div className="item"><a href="#">Blog</a></div>
          <div className="item"><a href="#">Contact</a>
          </div>
          <div className="item button"><a href="#">Log In</a></div>
          <div className="item button secondary"><a href="#">Sign Up</a></div>
          <div className="toggle"><a href="#"><i className="fas fa-bars"></i></a></div>
        </Menu>
      </Nav>
      {/* <Nav>
        <Brand>
